import React, { createContext, useState } from 'react';
import Menu from './Menu';

// Create a new context object
const AppContext = createContext();

// Create a provider component that takes the context object as a prop
const AppProvider = ({ children }) => {
	// Set up some state to share with the Menu component
	const [isActive, setIsActive] = useState(false);

	// Pass the state and state setter as values to the context provider
	return (
		<AppContext.Provider value={{ isActive, setIsActive }}>
			{children}
			<Menu />
		</AppContext.Provider>
	);
};

// Wrap your app in the provider component
const App = () => {
	return (
		<AppProvider>
			<div>Your app here</div>
		</AppProvider>
	);
};

export default App;
